import React, { Component } from 'react';


function  Frist() {
    const parsons = [
        {
            name: 'Jhon',
            age: 28,
            city: 'HO'
        },
        {
            name: 'Onhj',
            age: 82,
            city: 'HN'
        },
        {
            name: 'Nohj',
            age: 41,
            city: 'IT'
        }
    ];
    const parsonlist = parsons.map(parson => <h1>my name {parson.name}</h1>)
    return (
        <div>
{
    parsonlist
}
        </div>
    )
}

export default Frist;
